    (6, '202303', 'numerical-202303-2.html', 'Dari tahun 2013 ke tahun 2014, berapa persen perubahan jumlah peserta yang mendaftar di Universitas Adiwasesa? (hasil dibulatkan ke satuan)', 'turun 7%', 'naik 16%', 'naik 65%', 'naik 86%', 'bukan semuanya'),
