    (9, '202303', 'numerical-202303-3.html', 'Untuk semua lokasi di Jakarta, berlaku potongan harga 25% (untuk Standar) dan 40% (untuk Premium); berapa total nilai sewa untuk 1 hari di 1 lokasi Premium: 10 m2 di Jakarta Barat dan 1 lokasi Standar: 10 m2 di Jakarta Pusat?', 'Rp. 853.500,-', 'Rp. 1.101.500,-', 'Rp. 1.095.500,-', 'Rp. 1.105.100,-', 'bukan semuanya'),
