    (17, '202303', 'numerical-202303-5.html', 'Berapa harga total untuk 2 tiket pulang pergi (P/P), dengan memakai BIS PATAS yang paling cepat waktu tempuhnya dan juga menyediakan makan pagi?', 'Rp. 420.000,-', 'Rp. 540.000,-', 'Rp. 440.000,-', 'Rp. 340.000,-', 'bukan semuanya'),
    (18, '202303', 'numerical-202303-5.html', 'Dari Jogja, Anda harus bertemu dengan klien di kantornya di Semarang pada jam 13:00. Anda berencana naik taksi dari setasiun Kereta Api ataupun Bus Patas di Semarang, menuju kantornya yang kurang lebih akan memakan waktu 25 s/d 35 menit. Tiket termurah apa yang harus anda beli dari Jogja, kalau anda harus berangkat dari Jogja antara jam 09:00  09:30?', 'Kereta Api Jam 09:20', 'Kereta Api Jam 09:00', 'Bis Patas Jam 09:30', 'Bis Patas Jam 09:10', 'bukan semuanya'),
    (19, '202303', 'numerical-202303-5.html', 'Berapa perbedaan kecepatan rata antara kereta api yang berangkat jam 07:50 dan yang berangkat jam 10:30, dengan asumsi jarak tempuh Jogja  Semarang: 125 kilometer?', '3 km/jam', '5 km/jam', '4 km/jam', '6 km/jam', 'bukan semuanya'),
(20, '202303', 'numerical-202303-5.html', 'Kalau Anda harus bepergian dari Jogja ke Semarang secepat mungkin, dan harus memanfaatkan koneksi WiFi selama di perjalananan, serta harus sampai Semarang sebelum jam 13:00, berapa harga tiket 1 xjalan yang harus anda bayar?', 'Rp. 130.000,-', 'Rp. 100.000,-', 'Rp. 110.000,- ', 'Rp. 119.000,-', 'bukan semuanya');
