INSERT INTO gmate_doc (id, version, prompt, a, b, c, d, e) VALUES
('a1', '202303', 'Jika berwisata ke Taman Bunga Indonusa adalah insentif yang nilainya terendah, kepada siapa saja insentif tersebut akan Anda berikan?', 'Kelly, Sunarto, Chris, Truno', 'Kelly, Sunarto, Sandra, Chris', 'Tina, Sunarto, Kelly, Sandra', 'Muladi, Sunarto, Kelly, Truno', 'Kelly, Sandra, Sunarto, Truno'),
    ('a2', '202303', 'Jika tiga peringkat teratas paket ke luar negri adalah ke Amerika Serikat (sudah diberikan ke Muladi), ke Perancis (sudah diberikan ke Petra), dan ke Inggris; siapakah yang berhak menerima paket ke Inggris?', 'Sambas', 'Tina', 'Sandra', 'Lisa', 'Chris'),
    ('a3', '202303', 'Jika tiga paket ke luar kota peringkatnya adalah: ke Bali dan Lombok selama 2 minggu, kemudian ke Bali 1 minggu dan ke Bali 3 hari, siapa saja yang berhak menerima paket tersebut sesuai dengan urutan peringkatnya? (urutan nama menunjukkan peringkat)', 'Tina, Sandra, Sambas', 'Sambas, Sandra, Tina', 'Tina, Sambas, Sandra', 'Sandra, Sambas, Tina', 'Sambas, Tina, Sandra'),
    ('b1', '202303', 'Perusahaan mana yang mempunyai keuntungan kumulatif tertinggi untuk kuartal 3 dan 4?', 'DEF', 'JKL', 'ABC', 'MNO', 'GHI'),
    ('c1', '202303', 'Pernyataan mana di bawah ini yang paling akurat sehubungan dengan informasi yang Anda miliki?', 'Komentar pribadi jelas berpengaruh dalam proses promosi', 'Masa kerja di posisi saat ini dapat mengkompensasi kinerja yang kurang sempurna', 'Jarwo dipromosikan menggunakan tolok ukur yang subjektif', 'Karyawan lebih tua selalu dipromosikan sebelum karyawan lebih muda', 'Gunawan dan Elizabeth akan dipromosikan pada proses promosi berikutnya'),
    ('d1', '202303', 'Berdasarkan informasi di atas, sepatu merek apa yang dianggap paling mampu memenuhi keinginan pasar sepatu sport untuk anak muda?', 'Niko', 'Tiger', 'Elang', 'Advantage', 'Newlife'),
    ('d2', '202303', 'Sepatu merek apa yang dianggap paling mampu memenuhi keinginan pasar sepatu sport untuk anak muda dalam hal harga, tanpa mempedulikan masalah keawetan?', 'Niko', 'Tiger', 'Elang', 'Advantage', 'Newlife'),
    ('d3', '202303', 'Sepatu merek apa yang anda anggap dapat meraih pasar terbesar untuk mereka yang mengutamakan penampilan?', 'Niko', 'Tiger', 'Elang', 'Advantage', 'Newlife'),
    ('e1', '202303', 'Dari pernyataan berikut ini, mana yang tidak akan menghasilkan keputusan "ya" untuk tender sebuah proyek senilai Rp 125.000.000,-?', 'Kepala Divisi Pengadaan dan Direktur Operasional menyetujui, demikian juga Direktur Utama', 'Kepala Divisi Pengadaan tidak menyetujui, namun Direktur Operasional dan Direktur Utama menyetujui', 'Direktur Utama dan Kepala Divisi Pengadaan keduanya menyetujui', 'Kepala Divisi Pengadaan dan Direktur Operasional menyetujui, tetapi Direktur Utama tidak setuju', 'Manajer Pembelian, Kepala Divisi Terkait, Kepala Divisi Pengadaan, Direktur Operasional dan Direktur Utama menyetujui'),
    ('e2', '202303', 'Untuk tender dengan nilai di atas Rp 500.000.000,- tim yang paling tepat untuk memberikan persetujuan tender tersebut adalah:', 'Dir Utama, Dir. Operasional dan Kadiv Pengadaan', 'Dir Utama dan Dir. Operasional atau Dir Keuangan', 'Dir Utama, Dir. Operasional dan Dir Keuangan', 'Dir Utama dan Dir. Keuangan', 'Hanya Dir. Utama'),
    ('f1', '202303', 'Berdasarkan hasil evaluasi di atas, karyawan mana yang akan Anda pilih untuk menyelesaikan sebuah proyek dengan deadline yang ketat dan melibatkan analisis data yang mendalam? Selain itu, hasil proyek tersebut harus dipresentasikan secara lisan pada pertemuan departemen dalam bahasa yang mudah dipahami', 'Amir', 'Berta', 'Carlo', 'Denny', 'Erni'),
    ('f2', '202303', 'Berdasarkan hasil evaluasi di atas, siapa yang akan yang anda pilih untuk memimpin proyek dengan anggota tim yang banyak dan beragam dan jangka waktu yang lama?', 'Amir', 'Berta', 'Carlo', 'Denny', 'Erni'),
    ('g1', '202303', 'Jika hasil meeting di atas harus Anda sampaikan secara ringkas kepada atasan Anda, mana di antara alternatif berikut ini yang akan Anda pilih sebagai kesimpulan yang Anda ambil?', 'Perusahaan harus menambah 15 karyawan baru, biaya training akan meningkat, dan ruang kantor diperluas', 'Produktivitas dan biaya training akan meningkat', 'Ruang kantor mungkin harus diperluas dan produktivitas akan menurun', 'Jalur produksi B harus menambah lima karyawan baru dan produktivitas akan menurun', 'Jalur produksi A harus menambah lima karyawan baru dan biaya training akan menurun'),
    ('h1', '202303', 'Pada tahap mana saja Gilang akan bekerja?', '1 dan 4', '3 dan 4', '2 dan 3', '2 dan 4', '1 dan 3'),
    ('h2', '202303', 'Siapa sajakah anggota tim untuk tahap 1?', 'Parti dan Tari', 'Parti dan Heru', 'Tari dan Yudi', 'Heru dan Tari', 'Gilang dan Tari'),
    ('i1', '202303', 'Karyawan mana yang kemungkinan besar dapat Anda andalkan untuk dapat tepat waktu pada meeting di pagi hari?', 'Yuli', 'Yudi', 'Melisa', 'Yuli, Yudi dan Melisa', 'Tidak dapat ditentukan'),
    ('i2', '202303', 'Dengan menggunakan informasi kebijakan dan catatan kehadiran Yudi, situasi mana di bawah ini akan/dapat berkonflik dengan kebijakan cuti?', '19 April hari ijin pribadi', '16 Maret hari sakit', 'Dimintakan pada hari Selasa untuk mengambil cuti pada hari Rabu minggu berikutnya sebagai hari ijin pribadi untuk mempersiapkan pesta ulang tahun anaknya', 'Cuti kematian di bulan Februari', 'Hari-hari sakit di bulan Januari'),
    ('i3', '202303', 'Karyawan mana yang kebiasaan cutinya paling mengkhawatirkan?', 'Yuli', 'Yudi', 'Melisa', 'Melisa dan Yudi', 'Yuli dan Melisa'),
    ('j1', '202303', 'Sekarang jam 13.00 dan salesman tersebut sedang keluar makan siang. Sebagai manajer, tindakan apa yang paling tepat Anda lakukan?', 'Menanyakan kepada customer itu apakah ia ingin memilih seorang salesman baru atau apakah ia akan lebih suka jika Anda sendiri yang bertindak menjadi salesman', 'Memberitahu customer itu bahwa Anda akan meninggalkan pesan untuk salesman tersebut agar segera menghubunginya', 'Memberitahukan kepada customer itu bahwa kalau bukan salesman itu, Anda sendiri yang akan menghubunginya hari ini juga untuk memberi informasi yang diminta', 'Setuju untuk membantu customer itu dan menjanjikan jawaban dari salesman tersebut pada hari ini sebelum jam 17.00', 'Menjelaskan kepada customer bahwa bukanlah tanggungjawab Anda untuk menangani keluhan dan menyarankan agar dia menghubungi customer service'),
    ('k1', '202303', 'Arti lain dari pernyataan Fred di atas adalah:', 'Fred ingin menunjukkan bahwa Pak Yunus omong kosong atau mengada-ada', 'Fred berpikir bahwa keuntungan jangka pendek selaras dengan keuntungan jangka panjang', 'Fred fokus pada biaya produksi yang dibandingkan dengan harga jual', 'Fred mengingatkan pada semua bahwa upaya kerjasama antar departemen tidak berjalan sejak tahun lalu', 'Fred berpikir keuntungan perusahaan dan ekspansi itu saling bergantung satu sama lain'),
    ('l1', '202303', 'Asumsikan semua pernyataan di bawah benar, pernyataan mana yang paling jelas menunjukkan ketidak-cocokan rumus di atas untuk mengkalkulasi tingkat efisiensi?', 'Yusti menggunakan kebanyakan waktu di luar kantor', 'Melani adalah salesman yang paling efisien di perusahaan', 'Tak seorang pun di antara salesman itu mempunyai tingkat efisiensi yang dapat diterima', 'Tingkat efisiensi gabungan untuk Melani dan Amy lebih tinggi daripada Lerbin dan Yusti', 'Penjualan Amy merupakan 40% total penjualan'),
    ('m1', '202303', 'Jika Anda diminta untuk mengerjakan riset di luar kantor selama dua jam pada sore hari, hari apakah yang paling cocok?', 'Senin', 'Selasa', 'Rabu', 'Kamis', 'Jumat'),
    ('m2', '202303', 'Anda harus ke luar kota pada hari Jumat jam 14.00. Dengan berpegang pada jadwal Anda seperti tercantum pada Kondisi 11 di atas, kapankah waktu terbaik untuk menjadwal- ulang rapat informal dengan staf di kantor?', 'Senin jam 14.00', 'Selasa jam 14.00', 'Kamis jam 15.00', 'Rabu jam 14.00', 'Bukan semua di atas'),
    ('m3', '202303', 'Salah seorang klien akan berkunjung ke kantor Anda minggu depan. Hari apa yang paling memungkinkan jika Anda harus menggunakan satu hari penuh dengan klien Anda?', 'Senin', 'Selasa', 'Rabu', 'Kamis', 'Jumat'),
    ('n1', '202303', 'Perusahaan Anda sedang mempertimbangkan untuk melakukan restrukturisasi, di mana Anda adalah orang yang diminta untuk mempertimbangkan gagasan itu. Dengan data-data sebagaimana grafik-grafik di atas, rekomendasi terbaik apa yang dapat Anda sampaikan?', 'Upayakan agar persentase nilai penjualan tiap cabang menandingi persentase nilai penjualan kompetitor', 'Perkuat cabang Jawa Timur dan Jawa Tengah untuk mengambil keuntungan dari lebih kecilnya persentase nilai penjualan kompetitor', 'Mengurangi persentase nilai penjualan Jawa Barat dan DKI agar setara dengan persentase nilai penjualan kompetitor', 'Perusahaan tidak perlu melakukan restrukturisasi', 'Jangan sarankan apapun; sampai Anda memperoleh lebih banyak informasi tentang hal-hal yang berhubungan dengan restrukturisasi'),
    ('o1', '202303', 'Siapakah yang Anda asumsikan akan paling jarang mengalami masalah dalam menjalankan pekerjaannya secara keseluruhan?', 'Ari', 'Bayu', 'Cahyo', 'Dina', 'Emil'),
    ('o2', '202303', 'Siapakah yang paling mungkin mengalami hal berikut ini: mampu bekerja dalam kelompok yang anggotanya berasal dari beragam fungsi, namun akan mengalami kesulitan ketika terlibat pada beberapa kegiatan secara bersamaan?', 'Ari', 'Bayu', 'Cahyo', 'Dina', 'Emil'),
    ('p1', '202303', 'Berdasarkan tabel rencana pemesanan di atas, Anda mengidentifikasi sebuah pemesanan material yang akan menimbulkan problem produksi. Material apakah yang dimaksud?', 'Baja Gulung', 'Baja Lembaran', 'Kawat Baja', 'Besi Cor', 'Pipa Aluminium'),
    ('p2', '202303', 'Berdasarkan data diatas Anda menyadari bahwa ada dokumen penagihan untuk salah satu item yang dipesan Karno akan dipertanyakan oleh bagian Keuangan. Item mana yang memiliki kemungkinan terbesar akan dipertanyakan?', 'Baja Gulung', 'Baja Lembaran', 'Pipa Baja', 'Kawat Baja', 'Besi Cor'),
    ('q1', '202303', 'Meskipun alokasi waktu Meri pada proyek C, Tomi pada proyek B, dan Sari pada proyek A sama-sama sebesar 10 jam/minggu, tetapi:', 'Kontribusi Meri terhadap proyek C lebih tinggi dari kontribusi Tomi pada proyek B', 'Kontribusi Meri terhadap proyek C sama dengan kontribusi Sari pada proyek A', 'Kontribusi Tomi pada proyek B lebih tinggi dari kontribusi Sari pada Proyek A', 'Kontribusi Tomi pada proyek B sama dengan kontribusi Sari pada Proyek A', 'Semua jawaban di atas salah'),
    ('q2', '202303', 'Siapakah yang akan paling memberikan dampak terbesar terhadap seluruh proyek ketika dia tidak masuk?', 'Meri', 'Tomi', 'Sari', 'Meri atau Tomi', 'Tomi atau Sari'),
    ('r1', '202303', 'Berdasarkan grafik dan tabel di atas, tentukan mana di antara pernyataan-pernyataan berikut yang salah', 'Pada tahun 2000, nilai keuntungan divisi A adalah Rp 650.000.000,-', 'Pada tahun 1996, divisi B memiliki angka indeks keuntungan tertinggi', 'Pada tahun 1997, divisi A dan C sama-sama memberikan keuntungan', 'Pada tahun 1998, angka indeks keuntungan divisi C lebih kecil dari pada divisi B', 'Pada tahun 1999, angka indeks keuntungan divisi A lebih besar daripada divisi B'),
    ('s1', '202303', 'Mana pengaturan display/set berikut yang harus dihindari oleh salesman Anda?', 'Program SIMKEU, Notebook Anyer, dan Monitor GL', 'Notebook Anyer, Monitor GL, dan Printer Conan', 'Mouse Logik, Komputer BIM, dan Printer Conan', 'Program SIMKEU, Komputer PC BIM, dan Monitor GL', 'Mouse Logik, Komputer BIM, dan Program SIMKEU'),
    ('s2', '202303', 'Jika komputer BIM tidak dijadikan satu dengan printer Conan, produk apa saja yang bisa digabung dengan komputer BIM?', 'Mouse Logik dan Monitor GL', 'Monitor GL dan Program SIMKEU', 'Mouse Logic dan Notebook Anyer', 'Program SIMKEU dan Notebook Anyer', 'Bukan semua jawaban di atas'),
    ('t1', '202303', 'Kedua perusahaan di atas menawarkan untuk memberikan pelayanan mesin fotokopi dengan kesepakatan service seperti di atas. Mesin fotokopi yang mereka tawarkan berasal dari merek dan tipe yang sama, namun pelayanannya yang berbeda. Jika Anda memilih perusahaan fotokopi BERSAUDARA, alasan apa yang mendasari keputusan tersebut?', 'Perusahaan BERSAUDARA tidak menarik biaya perjalanan untuk 5 kilometer pertama', 'Jenis mesin fotokopi lebih penting daripada biaya service', 'Biaya sifatnya kritikal dan perusahaan BERSAUDARA akan melayani pembelanjaan besar', 'Perusahaan Anda tidak berencana membeli sebuah mesin fotokopi sampai layanan ini tidak berjalan lancar; sehingga garansi penggantian spare-parts menjadi penting', 'Anda merasa lebih cocok mempunyai kontrak dengan perusahaan yang sudah mapan'),
    ('u1', '202303', 'Perusahaan Anda mengadakan program pelatihan manajemen madya. Semua supervisor yang berminat mengikuti program tersebut diharuskan mencapai nilai minimal pada sejumlah tes: nilai 40 untuk Ketrampilan Verbal, nilai 45 untuk Pemahaman Bacaan, dan nilai 30 untuk Penalaran Matematika. Siapa di antara supervisor di bawah ini yang memenuhi syarat untuk mengikuti program pelatihan tersebut?', 'Budi, Karmila', 'Karmila, Rudi', 'Budi, Karmila, Rudi', 'Karno, Karmila, Rudi', 'Budi, Karno, Rudi'),
    ('u2', '202303', 'Ada sejumlah inisiatif proyek baru akan dilakukan dalam waktu 12 bulan mendatang. Untuk bisa terlibat dalam proyek tersebut, para supervisor harus mencapai nilai 25, 23, dan 35 berturut-turut pada tes Penalaran Matematika, Ketrampilan Verbal dan Pemahaman Bacaan. Bagi supervisor yang dua dari tiga nilai tersebut di atas masih di bawah persyaratan diberi kesempatan untuk mengikuti pelatihan khusus. Siapa saja yang punya kesempatan untuk mengikuti pelatihan khusus tersebut?', 'Budi saja', 'Sumadi saja', 'Gina saja', 'Gina dan Sumadi', 'Budi dan Gina'),
    ('v1', '202303', 'Manakah alasan keluar yang mengindikasikan ketidakmampuan orang untuk menetapkan prioritas dan mengorganisasikan tugas-tugas?', 'a', 'b', 'c', 'd', 'e'),
    ('v2', '202303', 'Jika penjelasan mengenai tugas dan tanggung jawab pekerjaan yang diberikan kepada para pelamar cukup jelas dan tidak dilebih-lebihkan; alasan keluar manakah yang paling mungkin akan berkurang?', 'a', 'b', 'e', 'a dan e', 'a dan b'),
    ('w1', '202303', 'Anda tersinggung karena bukan haknya untuk memutuskan hal tersebut, namun Anda tidak ingin menambah jarak lebih jauh lagi. Langkah apa terbaik untuk Anda lakukan?', 'Menyetujui keputusan Pundi dan kontrak itu berlaku', 'Kontrak itu tetap berlaku, namun informasikan kepada manajemen yang lebih tinggi mengenai adanya pelanggaran prosedur', 'Hubungi Bina Utama, dan jelaskan bahwa kontrak itu tidak sah namun mereka masih punya kesempatan untuk mendapatkan yang sah', 'Jelaskan proses evaluasi tawaran kepada Pundi, dan biarkan dia memutuskan apakah kontrak itu masih berlaku atau tidak', 'Lakukan proses evaluasi tawaran seperti biasa, dan abaikan kontrak yang dibuat oleh Pundi'),
    ('x1', '202303', 'Berdasarkan informasi dan grafik di atas, pada kuartal ke berapa konfigurasi kondisi jumlah pekerja dibandingkan dengan rerata produksi paling optimal?', 'Kuartal ke-1', 'Kuartal ke-2', 'Kuartal ke-3', 'Kuartal ke-4', 'Bukan semua di atas'),
    ('y1', '202303', 'Berdasarkan grafik di atas, cabang manakah yang bisa dianggap paling efisien?', 'Medan', 'Surabaya', 'Surakarta', 'Yogyakarta', 'Denpasar'),
    ('y2', '202303', 'Berdasarkan grafik di atas, cabang mana sajakah yang paling tepat guna untuk dijadikan obyek riset dan pengembangan strategi penjualan dan pemasaran?', 'Surakarta dan Semarang', 'Yogyakarta dan Jakarta', 'Bandung dan Jakarta', 'Palembang dan Bandung', 'Yogyakarta dan Palembang'),
    ('y3', '202303', 'Berdasarkan grafik di atas, cabang manakah yang memberi keuntungan paling tinggi?', 'Jakarta', 'Surabaya', 'Surakarta', 'Medan', 'Semarang'),
('z1', '202303', 'Jika Anda ingin memastikan kedua karyawan itu ditegur, bagaimana cara yang paling diplomatis untuk melakukannya, mengingat Anda dan Bu Yati adalah kolega yang setara kedudukannya?', 'Dekati karyawan yang masih di situ dan dengan perlahan beri teguran', 'Panggil kedua bawahan Bu Yati tersebut ke ruangan Anda setelah Anda berbicara dengan klien Anda', 'Beritahu Pak Farid mengenai kekhawatiran Anda dengan harapan Beliau akan membicarakannya secara serius dengan Bu Yati', 'Dekati Bu Yati dan sarankan agar dia mendisiplin karyawannya', 'Selesaikan urusan dengan pelanggan Anda terlebih dahulu baru kemudian memikirkan rencana tindakan sehubungan dengan kasus perdebatan tadi');
